const Home = () => {
  return (
    <div style={{display:"flex" , justifyContent:"space-between" , alignItems:"center" , }}>

      <div style={{height:"200px" ,  width:"200px" ,background:"yellow"}}>1</div>
      <div style={{height:"200px" ,  width:"200px" ,background:"yellow"}}>2</div>
      <div style={{height:"200px" ,  width:"200px" ,background:"yellow"}}>3</div>
      <div style={{height:"200px" ,  width:"200px" ,background:"yellow"}}>4</div>

    </div>
  )
}

export default Home
